/* eslint-disable consistent-return */
import ArticleEmployment from 'components/common/ArticleEmployment';
import React, { useEffect } from 'react';
import { useSelector } from 'react-redux';
import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';
import { CustomGet } from 'utils/api';

function BookmarkPage() {
	const navigate = useNavigate();

	const testArr = new Array(5).fill(2);

	const { isLogin, userId, jwt } = useSelector(
		(state) => state.UserDataReducer,
	);

	useEffect(() => {
		if (isLogin) {
			navigate('/');
			return;
		}
		let isCompleted = false;
		const getDetailData = async () => {
			try {
				const data = CustomGet({
					url: `/web/bookMarkList/${userId}`,
					headers: {
						jwt,
					},
				});
				if (!isCompleted) {
					data.then((res) => {
						console.log(res.result);
					});
				}
			} catch (error) {
				console.log(error);
			}
		};
		getDetailData();
		return () => {
			isCompleted = true;
		};
	}, []);

	return (
		<ComponentWrapper>
			<nav role="presentation" className="nav-container">
				<h2 className="Nav_Nav_title__4b9t6">
					<p>북마크</p>
				</h2>
			</nav>
			<div className="bookmarklist-container">
				<ul className="clearfix">
					{testArr.map((value) => (
						<li>
							<ArticleEmployment />
						</li>
					))}
				</ul>
				<div />
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	padding-bottom: 100px;
	margin: 0 auto;
	width: 87.72%;
	position: relative;
	max-width: 1060px;
	.nav-container {
		position: relative;
		line-height: normal;
		p {
			font-size: 20px;
			font-weight: 700;
			color: #333;
			padding: 50px 0 20px;
		}
	}

	.bookmarklist-container > ul {
		margin: -10px;
		padding: 0;
		li {
			width: 25%;
			padding: 10px;
			list-style: none;
			display: inline-block;
			vertical-align: top;
		}
	}

	.clearfix:before {
		content: ' ';
		display: table;
	}
	.clearfix:after {
		clear: both;
	}
`;

export default BookmarkPage;
